import React from 'react'
import List from './ListCategory'

function SideBar(){
    const list = List.map(item=><div className="col-md-4">
            <label className="checkbox">
                <input type="checkbox"/>
                <span ></span>
            </label>
        {item.name}
        </div>

    )


     return(

         {list}

        )


}

export default SideBar
